import React, { useEffect, useState } from 'react'
import { PieChart } from '@mui/x-charts/PieChart';
import { getPieChartData } from '../api';

function Pie() {
    const [pieData, setPieData] = useState([])
    useEffect(() => {
        getPieChartData()
            .then(res => {
                console.log("Pie chart data")
                console.log(res)
                setPieData(res)
            })
        return () => { }
    }, [])
    return (
        <div>
            <PieChart
                colors={[ '#FEFFFF','F3FEEF','#E6FFE6', '#D0FFD0', '#B0FAB0', '#90EE90' ]} // Use palette
                series={[{ data: pieData }]}
                width={400}
                height={200} />
        </div>
    )
}

export default Pie
